import catgirl from './Gay-Cat.png'
import './App.css';
let count = 0;
function App() {


  return (
    <div className="App">
      <header className="App-header">
        <div align="center">Gay Catgirl on screen for {count} seconds</div>
	      <div align="center"> <img src={catgirl} alt="Gay Cat"/></div>
      </header>
    </div>
  );
}
function tick(){
  count++;
  root.render(App);
}
export default App;
